import React from 'react';

const Home = () => {
	let samplePosts = [];
	for (let index = 0; index < 8; index++) {
		index % 2 === 0
			? samplePosts.push(
					<li key={index}>
						<Post />
					</li>
				)
			: samplePosts.push(
					<li key={index}>
						<Post2 />
					</li>
				);
	}
	return (
		<div>
			<Link to="/gallery">try catch</Link>
		</div>
	);
};

export default Home;
